import React from 'react';
import { Container, Row, Col } from 'reactstrap';
import './App.css';
import Header from './components/header'
import MovileList from './pages/movielist'
import { Route , Link } from 'react-router-dom'

function App() {
  return (
    <div>
      <Header></Header>
      <Route path='/' component={MovileList}></Route>
    </div>
  );
}

export default App;
